import React from "react";
import Card from "./Card";
import {robots} from "./robots";


const CardList =() =>
{
  return(
    <div>
    {
      robots.map((user, i) =>
      {
      return(
      <Card 
      // key={i}
      key={robots[i].id} 
      name={robots[i].name} 
      email={robots[i].email}
        />
        );
      })
    }
            

    </div>
  
  
  );
}
export default CardList;
